import React, { Component } from 'react';
import './Header.css';
import logo from './img/logo-dm.png';



const NavigationBar = () => {
    return (
        <nav>
            <ul>
                <li>
                    <a className="" href="#about"></a>
                    <a className="" href="#wallet"></a>
                    <a className="" href="#whitepaper"></a>
                    <a className="" href="#roadmap"></a>
                    <a className="" href="#financing"></a>
                    <a className="" href="#faq"></a>
                </li>
                <LanguageSelector />
            </ul>
        </nav>
    );
}

const LanguageSelector = () => {
    return(
        <li>

        </li>
    );
}

const PageLogo = () => {
    return(
        <a href="/">
            <img src={logo} alt="Logo"/>
        </a>
    );
}

class Header extends Component {

    render(){
        return(
            <header>
                <div className="container">
                    <PageLogo />
                    <button className="burgerBtn">&equiv;</button>
                    <NavigationBar />
                </div>
            </header>
        );
    }
}

export default Header;
